import React, { Component } from 'react';

function logout() {
    localStorage.clear();
    window.location.href = '/';
}


class LogOut extends Component {
    render() {
        return (
            <div>
                <a href="#" onClick={this.logout()}>LOGOUT</a>
            </div>
        );
    }
}

export default LogOut;
